import React from "react";

class CarAnnonce extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            title: '',
            description: '',
            price: 0
        }
    }

    handleChange = (e) => {
        e.target.name
        this.setState({
            title: e.target.value
        })
    }

    render() {
        return(
            <div>
                <label for="title" className="form-label">Tittelen</label>
                <div className="input-group mb-3">
                    <input type="text" className="form-control" id="title" aria-describedby="title"/>
                </div>
                <label for="description" className="form-label">Beskrivelse</label>
                <div className="input-group mb-3">
                    <textarea className="form-control" id="description" rows="3"/>
                </div>
                <label for="price" className="form-label">Pris</label>
                <div className="input-group mb-5">
                    <span className="input-group-text">Nok</span>
                    <input type="number" className="form-control" id="price" placeholder="0"></input>
                    <input type="number" className="form-control" id="price" placeholder=".00"></input>
                </div>
                <button type="submit" className="btn btn-primary w-100">Publiser</button>
            </div>
        )
    }
}

export const car = {
    name: "Bil",
    id: 9876,
    subs: [
        {title : "benzinli", desc: "benzinli araba"},
        {title : "dizel", desc: "dizel araba"},
        {title : "hybrid", desc: "dizel araba"},
    ],
    component: <CarAnnonce/>
}

export default CarAnnonce;
